import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';

class Header extends Component {


    state = {
        page: [
            {
                name: "Home",
                linkTo: '/',
                public: true
            },
            {
                name: "Guitars",
                linkTo: '/shop',
                public: true
            }
        ], 
        user: [
            {
                name: "My Cart",
                linkTo: '/user/cart',
                public: false
            },
            {
                name: "My Account",
                linkTo: '/user/dashboard',
                public: false
            },
            {
                name: "Log In",
                linkTo: '/register_login',
                public: true
            },
            {
                name: "Log Out",
                linkTo: '/user_logout',
                public: true
            }
        ]
    }

    render() {
        return (
            <header className="bck_b_light">
                <div className="container">
                    <div className="left">
                        <div className="logo">
                            WAVES
                        </div>
                    </div>
                    <div className="right">
                        <div className="top">
                            Links
                        </div>
                        <div className="bottom">
                            LINKS
                        </div>
                    </div>
                </div>
            </header>
        );
    }
}

function mapStateToProps(state){
    return{
        user : state.user
    }
}

export default connect(mapStateToProps)(Header);
